       <Practice setup={ 'How did the hacker escape the police?' } punchline={ 'He just ransomeware!' }/>
       <Practice setup={ "Why don't pirates travel on mountain roads?" } punchline={ 'Scurvy.' }/>
      {/* <Practice setup={  } punchline={  }/> */}
    </div>
  );
}
